import logo from './logo.svg';
import './App.css';

function App() {
  return (
      <div>
        <div>
          <form>
            <label for='name'>Name</label>
            <input type="text" id="name"></input>
            <input type="submit" value="Submit" id="submit"></input>
          </form>
        </div>
      </div>
  );
}

export default App;
